script: |
  super -f tsv -I q7395.sql | sort > q7395.out

vector: true

inputs:
  - name: q7395.sql
    data: |
      SELECT DISTINCT col1 AS col2, + 70 FROM tab1 WHERE + col1 NOT BETWEEN - col0 - - col2 * + col2 AND NULL;
  - name: tab1

outputs:
  - name: q7395.out
    data: |
      14	70
      47	70
      5	70
